import React from 'react';
import logo from '../../assets/homescreen.jpg';
import './Home.css';

function Home() {
    return (
        <div className="App">
            <div className="module">
                <header>
                    <h1>Carlos</h1>
                </header>
            </div>
            {/*
            <img src={logo} className="wallpaper" alt="space wallpaper"/>

            */}
            <header className="App-header">

                <p>
                    Edit <code>src/App.js</code> and save to reload.
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                </a>
            </header>
        </div>
    );
}

export default Home;
